import * as React from "react";
import data from "../mock-data.json";

export const Table = () => {
  const [workouts, setWorkout] = React.useState(data);

  const renderHeader = () => {
    let headerElement = ["Exercise Name", "Rep", "Sets"];

    return headerElement.map((key, index) => {
      return <th key={index}>{key.toUpperCase()}</th>;
    });
  };
  const renderTableData = () => {
    return workouts.map((element) => {
      element.exercises.forEach(({ exerciseName, rep, sets }) => {
        return (
          <tr>
            <td>{exerciseName}</td>
            <td>{rep}</td>
            <td>{sets}</td>
          </tr>
        );
      });
    });
  };

  return (
    <div className="table-container">
      <table id="workouts" className="center">
        <thead>
          <tr>{renderHeader()}</tr>
        </thead>
        <tbody>{renderTableData()}</tbody>
      </table>
    </div>
  );
};
